	
alter table cutoffs add column gender char;
update cutoffs set gender='l' where seattype like 'l%';
update cutoffs set gender='g' where seattype like 'g%';
update cutoffs set seattype = substring(seattype, 2) where seattype like 'g%';
update cutoffs set seattype = substring(seattype, 2) where seattype like 'l%';
update cutoffs set seattype = 'NTB' where seattype in ("NTBH","NTBO");
update cutoffs set seattype = 'NTC' where seattype in ("NTCH","NTCO");
update cutoffs set seattype = 'NTD' where seattype in ("NTDH","NTDO");
update cutoffs set seattype = 'OBC' where seattype in ("OBCH","OBCO");
update cutoffs set seattype = 'OPEN' where seattype in ("OPENH","OPENO");
update cutoffs set seattype = 'ST' where seattype in ("STO","STH");
update cutoffs set seattype = 'SC' where seattype in ("SCO","SCH");
update cutoffs set seattype = 'VJ' where seattype in ("VJH","VJO");
